import React from 'react';
import IconHTML from '../img/icons/icon0.png';
import IconCSS from '../img/icons/icon1.png';
import IconBS from '../img/icons/icon2.png';
import IconJS from '../img/icons/icon3.png';
import IconREACT from '../img/icons/icon4.png';
import IconSASS from '../img/icons/icon5.png';
import IconGIT from '../img/icons/icon6.png';
import IconUI from '../img/icons/icon7.png';
import IconPS from '../img/icons/icon8.png';
import IconIL from '../img/icons/icon9.png';
import Icon3D from '../img/icons/icon10.png';



export const IconeHTML = () => {
    return  <div> <img src={IconHTML} alt="HTML"></img> </div>;
  };

  
export const IconeCSS = () => {
    return  <div> <img src={IconCSS} alt="CSS"></img> </div>;
  };

  
export const IconeBS = () => {
    return  <div> <img src={IconBS} alt="Bootstrap"></img> </div>;
  };

  export const IconeJS = () => {
    return  <div> <img src={IconJS} alt="Javascript"></img> </div>;
  };

  
export const IconeREACT = () => {
    return  <div> <img src={IconREACT} alt="React.js"></img> </div>;
  };

  
export const IconeSASS = () => {
    return  <div> <img src={IconSASS} alt="Sass"></img> </div>;
  };

export const IconeGIT = () => {
    return  <div> <img src={IconGIT} alt="GitHub"></img> </div>;
  };

export const IconeUI = () => {
    return  <div> <img src={IconUI} alt="UX/UI"></img> </div>;
  };  

export const IconePS = () => {
    return  <div> <img src={IconPS} alt="Photoshop"></img> </div>;
  };


export const IconeIL = () => {
    return  <div> <img src={IconIL} alt="Illustrator"></img> </div>;
  };
  
export const Icone3D = () => {
    return  <div> <img src={IconGIT} alt="3D"></img> </div>;
  };
